import React, { useState } from 'react'
import Navbar from './Navbar';
import './Navbar_style.css';
import './AccountPage.css';
import axios from 'axios';
import Cookies from 'js-cookie';

export const AccountPage = () => {
	// const userEmail = getCookieValue('email'); // Replace with your cookie reading logic
	const userEmail = Cookies.get('email'); // Replace with your cookie reading logic
	const [userdetails, setdata] = useState([]);
	axios.get(`http://localhost:3001/user/${userEmail}`)
		.then(response => {
			setdata(response.data);
			console.log(response.data); // User data
		})
		.catch(error => {
			console.error('Error fetching user data:', error);
		});

	const handleChange = (e) => {
		const { name, value } = e.target;
		// For nested state handling (address fields)
		if (name.startsWith('address.')) {
			const addressKey = name.split('.')[1];
			setdata({
				...userdetails,
				address: { ...userdetails.address, [addressKey]: value },
			});
		} else {
			setdata({ ...userdetails, [name]: value });
		}
	};


	return (
		<div>

			<Navbar />
			<div>
				<h2>userdetails Page</h2>
				<div>
					<label>
						First Name:
						<textarea name="firstName" value={userdetails.FirstName} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						Last Name:
						<textarea name="lastName" value={userdetails.LastName} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						Email:
						<textarea name="email" value={userdetails.EmailId} onChange={handleChange} disabled />
					</label>
				</div>
				<div>
					<label>
						Age:
						<textarea name="age" value='0' onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						Street:
						<textarea name="address.street" value={userdetails.address.street} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						City:
						<textarea name="address.city" value={userdetails.address.city} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						State:
						<textarea name="address.state" value={userdetails.address.state} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						ZIP Code:
						<textarea name="address.zip" value={userdetails.address.zip} onChange={handleChange} />
					</label>
				</div>
				<div>
					<label>
						Gender:
						<textarea name="gender" value={userdetails.gender} onChange={handleChange} />
					</label>
				</div>
				{/* <div>
					<img src={userdetails.userdetailsPic} alt="userdetails" />
				</div> */}
			</div>
		</div>
	)
}


export default AccountPage;
